Ext.data.JsonP['Modules_SafariDialog']({"tagname":"class","name":"Modules.SafariDialog","extends":"Titanium.Module","mixins":[],"alternateClassNames":[],"aliases":{},"singleton":false,"requires":[],"uses":[],"enum":null,"override":null,"inheritable":null,"inheritdoc":null,"meta":{"platform":["iphone 5.1.0","ipad 5.1.0"],"editurl":"https://github.com/appcelerator-modules/Ti.SafariDialog/edit/master/apidoc/SafariDialog.yml","description":["<p>The SafariDialog module provides Titanium access to the native SFSafariViewController. This enables you to \ndeliver interactive web content in your app just like Safari, including the key Safari UI elements already \nfamiliar to your users. See how to easily bring Safari features like Reader and AutoFill into your app.</p>\n\n<h3>Requirements</h3>\n\n<p>The SafariDialog module is available with the Titanium SDK starting with Release 5.1.0.\nThis module only works with devices running iOS 9.\nPlease make sure you have at least Xcode 7 to build to the required sources.</p>\n\n<h3>Getting Started</h3>\n\n<p>Add the module as a dependency to your application by adding a <strong><code>&lt;module&gt;</code></strong> item to the\n<strong><code>&lt;modules&gt;</code></strong> element of your <code>tiapp.xml</code> file:</p>\n\n<pre><code>&lt;ti:app&gt;\n  ...\n  &lt;modules&gt;\n    &lt;module platform=\"iphone\"&gt;ti.safaridialog&lt;/module&gt;\n  &lt;/modules&gt;\n  ...\n&lt;/ti:app&gt;\n</code></pre>\n\n<p>Use <code>require()</code> to access the module from JavaScript:</p>\n\n<pre><code>var dialog = require('ti.safaridialog');\n</code></pre>\n\n<p>The <code>dialog</code> variable is a reference to the module. Make API calls using this reference:</p>\n\n<pre><code>if (dialog.isSupported()) {\n    dialog.open({\n        url: 'http://appcelerator.com',\n        title: 'Titanium rocks!',\n        tintColor: 'red'\n    });\n}\n</code></pre>\n\n<h3>Sample Application</h3>\n\n<p>The module contains a sample application in the\n<code>&lt;TITANIUM_SDK_HOME&gt;/modules/iphone/ti.safaridialog/&lt;VERSION&gt;/example/</code> folder.</p>"]},"private":null,"id":"class-Modules.SafariDialog","members":{"cfg":[],"property":[{"name":"DISMISS_BUTTON_STYLE_CANCEL","tagname":"property","owner":"Modules.SafariDialog","meta":{"readonly":true,"description":["<p>Use with the <code>dismissButtonStyle</code> property in {@link Modules.SafariDialog#method-open}.</p>"],"platform":["iphone 6.3.0","ipad 6.3.0"]},"id":"property-DISMISS_BUTTON_STYLE_CANCEL"},{"name":"DISMISS_BUTTON_STYLE_CLOSE","tagname":"property","owner":"Modules.SafariDialog","meta":{"readonly":true,"description":["<p>Use with the <code>dismissButtonStyle</code> property in {@link Modules.SafariDialog#method-open}.</p>"],"platform":["iphone 6.3.0","ipad 6.3.0"]},"id":"property-DISMISS_BUTTON_STYLE_CLOSE"},{"name":"DISMISS_BUTTON_STYLE_DONE","tagname":"property","owner":"Modules.SafariDialog","meta":{"readonly":true,"description":["<p>Use with the <code>dismissButtonStyle</code> property in {@link Modules.SafariDialog#method-open}.</p>"],"platform":["iphone 6.3.0","ipad 6.3.0"]},"id":"property-DISMISS_BUTTON_STYLE_DONE"},{"name":"apiName","tagname":"property","owner":"Titanium.Proxy","meta":{"readonly":true,"description":["<p>The value of this property is the fully qualified name of the API. For example, {@link Titanium.UI.Button Button}\nreturns <code>Ti.UI.Button</code>.</p>"],"platform":["android 3.2.0","iphone 3.2.0","ipad 3.2.0","windowsphone 4.1.0"]},"id":"property-apiName"},{"name":"bubbleParent","tagname":"property","owner":"Titanium.Proxy","meta":{"description":["<p>Some proxies (most commonly views) have a relationship to other proxies, often\nestablished by the add() method. For example, for a button added to a window, a\nclick event on the button would bubble up to the window. Other common parents are\ntable sections to their rows, table views to their sections, and scrollable views\nto their views. Set this property to false to disable the bubbling to the proxy's parent.</p>"],"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"property-bubbleParent"},{"name":"lifecycleContainer","tagname":"property","owner":"Titanium.Proxy","meta":{"description":["<p>If this property is set to a Window or TabGroup, then the corresponding Activity lifecycle event callbacks\nwill also be called on the proxy. Proxies that require the activity lifecycle will need this property set\nto the appropriate containing Window or TabGroup.</p>"],"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"property-lifecycleContainer"},{"name":"opened","tagname":"property","owner":"Modules.SafariDialog","meta":{"readonly":true,"deprecated":{"text":"6.3.0 Use the <Modules.SafariDialog.isOpen> method instead. \n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>"}},"id":"property-opened"},{"name":"supported","tagname":"property","owner":"Modules.SafariDialog","meta":{"readonly":true,"deprecated":{"text":"6.3.0 Use the <Modules.SafariDialog.isSupported> method instead. \n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>"}},"id":"property-supported"}],"method":[{"name":"addEventListener","tagname":"method","owner":"Titanium.Proxy","meta":{},"id":"method-addEventListener"},{"name":"applyProperties","tagname":"method","owner":"Titanium.Proxy","meta":{"description":["<p>Properties are supplied as a dictionary. Each key-value pair in the object is applied to the proxy such that\nmyproxy[key] = value.</p>"],"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-applyProperties"},{"name":"close","tagname":"method","owner":"Modules.SafariDialog","meta":{"description":["<p>var dialog = require('ti.safaridialog');\nif (dialog.isOpen()) {\n    dialog.close();\n}</p>"]},"id":"method-close"},{"name":"createAuthenticationSession","tagname":"method","owner":"Modules.SafariDialog","meta":{"platform":["iphone 6.3.0","ipad 6.3.0"]},"id":"method-createAuthenticationSession"},{"name":"fireEvent","tagname":"method","owner":"Titanium.Proxy","meta":{},"id":"method-fireEvent"},{"name":"getApiName","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.2.0","iphone 3.2.0","ipad 3.2.0","windowsphone 4.1.0"]},"id":"method-getApiName"},{"name":"getBubbleParent","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-getBubbleParent"},{"name":"getLifecycleContainer","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"method-getLifecycleContainer"},{"name":"getOpened","tagname":"method","owner":"Modules.SafariDialog","meta":{"deprecated":{"version":"6.3.0","text":"Use the <Modules.SafariDialog.isOpen> method instead."}},"id":"method-getOpened"},{"name":"getSupported","tagname":"method","owner":"Modules.SafariDialog","meta":{"deprecated":{"version":"6.3.0","text":"Use the <Modules.SafariDialog.isSupported> method instead."}},"id":"method-getSupported"},{"name":"isOpen","tagname":"method","owner":"Modules.SafariDialog","meta":{},"id":"method-isOpen"},{"name":"isSupported","tagname":"method","owner":"Modules.SafariDialog","meta":{},"id":"method-isSupported"},{"name":"open","tagname":"method","owner":"Modules.SafariDialog","meta":{"description":["<p>var dialog = require('ti.safaridialog');\nif (dialog.isSupported()) {\n    dialog.open({\n        url: '<a href=\"http://appcelerator.com\">http://appcelerator.com</a>',\n        title: 'Hello World',\n        tintColor: 'red'\n    });\n}</p>"]},"id":"method-open"},{"name":"removeEventListener","tagname":"method","owner":"Titanium.Proxy","meta":{"description":["<p>Multiple listeners can be registered for the same event, so the\n<code>callback</code> parameter is used to determine which listener to remove.</p>\n\n<p>When adding a listener, you must save a reference to the callback function\nin order to remove the listener later:</p>\n\n<pre><code>var listener = function() { Ti.API.info(\"Event listener called.\"); }\nwindow.addEventListener('click', listener);\n</code></pre>\n\n<p>To remove the listener, pass in a reference to the callback function:</p>\n\n<pre><code>window.removeEventListener('click', listener);\n</code></pre>"]},"id":"method-removeEventListener"},{"name":"setBubbleParent","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-setBubbleParent"},{"name":"setLifecycleContainer","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"method-setLifecycleContainer"}],"event":[{"name":"close","tagname":"event","owner":"Modules.SafariDialog","meta":{},"id":"event-close"},{"name":"load","tagname":"event","owner":"Modules.SafariDialog","meta":{"description":["<p>This event is invoked when the safari dialog completes the loading of the \nURL that you pass to it's initializer. It is not invoked for any subsequent \npage loads in the same safari dialog instance. </p>\n\n<p>Note: This event is available in Titanium SDK 6.0.0 and later.</p>"]},"id":"event-load"},{"name":"open","tagname":"event","owner":"Modules.SafariDialog","meta":{},"id":"event-open"}],"css_var":[],"css_mixin":[]},"linenr":33020,"files":[{"filename":"titanium.js","href":"titanium.html#Modules-SafariDialog"}],"html_meta":{"platform":"<ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>5.1.0</li><li class='platform-ipad'\n        title='iPad'>5.1.0</li></ul>","editurl":null,"description":"<p><p>The SafariDialog module provides Titanium access to the native SFSafariViewController. This enables you to \ndeliver interactive web content in your app just like Safari, including the key Safari UI elements already \nfamiliar to your users. See how to easily bring Safari features like Reader and AutoFill into your app.</p>\n\n\n\n\n<h3>Requirements</h3>\n\n\n\n\n<p>The SafariDialog module is available with the Titanium SDK starting with Release 5.1.0.\nThis module only works with devices running iOS 9.\nPlease make sure you have at least Xcode 7 to build to the required sources.</p>\n\n\n\n\n<h3>Getting Started</h3>\n\n\n\n\n<p>Add the module as a dependency to your application by adding a <strong><code>&lt;module&gt;</code></strong> item to the\n<strong><code>&lt;modules&gt;</code></strong> element of your <code>tiapp.xml</code> file:</p>\n\n\n\n\n<pre><code>&lt;ti:app&gt;\n  ...\n  &lt;modules&gt;\n    &lt;module platform=\"iphone\"&gt;ti.safaridialog&lt;/module&gt;\n  &lt;/modules&gt;\n  ...\n&lt;/ti:app&gt;\n</code></pre>\n\n\n\n\n<p>Use <code>require()</code> to access the module from JavaScript:</p>\n\n\n\n\n<pre><code>var dialog = require('ti.safaridialog');\n</code></pre>\n\n\n\n\n<p>The <code>dialog</code> variable is a reference to the module. Make API calls using this reference:</p>\n\n\n\n\n<pre><code>if (dialog.isSupported()) {\n    dialog.open({\n        url: 'http://appcelerator.com',\n        title: 'Titanium rocks!',\n        tintColor: 'red'\n    });\n}\n</code></pre>\n\n\n\n\n<h3>Sample Application</h3>\n\n\n\n\n<p>The module contains a sample application in the\n<code>&lt;TITANIUM_SDK_HOME&gt;/modules/iphone/ti.safaridialog/&lt;VERSION&gt;/example/</code> folder.</p>\n\n</p>"},"statics":{"cfg":[],"property":[],"method":[],"event":[],"css_var":[],"css_mixin":[]},"component":false,"superclasses":["Titanium.Proxy","Titanium.Module","Modules.SafariDialog"],"subclasses":[],"mixedInto":[],"parentMixins":[],"html":"<div><div class='sidebar'><ul class=\"sidebar-platforms\"><li class='platform-iphone' title='iPhone since Titanium SDK 5.1.0'>iPhone 5.1.0</li><li class='platform-ipad' title='iPad since Titanium SDK 5.1.0'>iPad 5.1.0</li></ul></div><div class='hierarchy'><div class='classes'><div class='subclass'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='docClass'>Titanium.Proxy</a></div><div class='subclass'> &gt; <a href='#!/api/Titanium.Module' rel='Titanium.Module' class='docClass'>Titanium.Module</a></div><div class='subclass'> &gt; <strong>Modules.SafariDialog</strong></div></div></div><div class='doc-contents'><p>Allows a Titanium application to use the iOS Safari ViewController to create an embedded browser.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>\n\n<p><p>The SafariDialog module provides Titanium access to the native SFSafariViewController. This enables you to \ndeliver interactive web content in your app just like Safari, including the key Safari UI elements already \nfamiliar to your users. See how to easily bring Safari features like Reader and AutoFill into your app.</p>\n\n\n\n\n<h3>Requirements</h3>\n\n\n\n\n<p>The SafariDialog module is available with the Titanium SDK starting with Release 5.1.0.\nThis module only works with devices running iOS 9.\nPlease make sure you have at least Xcode 7 to build to the required sources.</p>\n\n\n\n\n<h3>Getting Started</h3>\n\n\n\n\n<p>Add the module as a dependency to your application by adding a <strong><code>&lt;module&gt;</code></strong> item to the\n<strong><code>&lt;modules&gt;</code></strong> element of your <code>tiapp.xml</code> file:</p>\n\n\n\n\n<pre><code>&lt;ti:app&gt;\n  ...\n  &lt;modules&gt;\n    &lt;module platform=\"iphone\"&gt;ti.safaridialog&lt;/module&gt;\n  &lt;/modules&gt;\n  ...\n&lt;/ti:app&gt;\n</code></pre>\n\n\n\n\n<p>Use <code>require()</code> to access the module from JavaScript:</p>\n\n\n\n\n<pre><code>var dialog = require('ti.safaridialog');\n</code></pre>\n\n\n\n\n<p>The <code>dialog</code> variable is a reference to the module. Make API calls using this reference:</p>\n\n\n\n\n<pre><code>if (dialog.isSupported()) {\n    dialog.open({\n        url: 'http://appcelerator.com',\n        title: 'Titanium rocks!',\n        tintColor: 'red'\n    });\n}\n</code></pre>\n\n\n\n\n<h3>Sample Application</h3>\n\n\n\n\n<p>The module contains a sample application in the\n<code>&lt;TITANIUM_SDK_HOME&gt;/modules/iphone/ti.safaridialog/&lt;VERSION&gt;/example/</code> folder.</p>\n\n</p><ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>5.1.0</li><li class='platform-ipad'\n        title='iPad'>5.1.0</li></ul></div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-property'>Properties</h3><div class='subsection'><div id='property-DISMISS_BUTTON_STYLE_CANCEL' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-property-DISMISS_BUTTON_STYLE_CANCEL' class='name not-expandable'>DISMISS_BUTTON_STYLE_CANCEL</a><span> : Number</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'><p>Button style used to display a localized \"Cancel\" button.</p>\n\n</div><div class='long'><p>Button style used to display a localized \"Cancel\" button.</p>\n\n<p><p>Use with the <code>dismissButtonStyle</code> property in <a href=\"#!/api/Modules.SafariDialog-method-open\" rel=\"Modules.SafariDialog-method-open\" class=\"docClass\">open</a>.</p>\n\n</p><ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>6.3.0</li><li class='platform-ipad'\n        title='iPad'>6.3.0</li></ul></div></div></div><div id='property-DISMISS_BUTTON_STYLE_CLOSE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-property-DISMISS_BUTTON_STYLE_CLOSE' class='name not-expandable'>DISMISS_BUTTON_STYLE_CLOSE</a><span> : Number</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'><p>Button style used to display a localized \"Close\" button.</p>\n\n</div><div class='long'><p>Button style used to display a localized \"Close\" button.</p>\n\n<p><p>Use with the <code>dismissButtonStyle</code> property in <a href=\"#!/api/Modules.SafariDialog-method-open\" rel=\"Modules.SafariDialog-method-open\" class=\"docClass\">open</a>.</p>\n\n</p><ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>6.3.0</li><li class='platform-ipad'\n        title='iPad'>6.3.0</li></ul></div></div></div><div id='property-DISMISS_BUTTON_STYLE_DONE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-property-DISMISS_BUTTON_STYLE_DONE' class='name not-expandable'>DISMISS_BUTTON_STYLE_DONE</a><span> : Number</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'><p>Button style used to display a localized \"Done\" button.</p>\n\n</div><div class='long'><p>Button style used to display a localized \"Done\" button.</p>\n\n<p><p>Use with the <code>dismissButtonStyle</code> property in <a href=\"#!/api/Modules.SafariDialog-method-open\" rel=\"Modules.SafariDialog-method-open\" class=\"docClass\">open</a>.</p>\n\n</p><ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>6.3.0</li><li class='platform-ipad'\n        title='iPad'>6.3.0</li></ul></div></div></div><div id='property-apiName' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-apiName' class='name not-expandable'>apiName</a><span> : String</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'><p>The name of the API that this proxy corresponds to.</p>\n\n</div><div class='long'><p>The name of the API that this proxy corresponds to.</p>\n\n<p><p>The value of this property is the fully qualified name of the API. For example, <a href=\"#!/api/Titanium.UI.Button\" rel=\"Titanium.UI.Button\" class=\"docClass\">Button</a>\nreturns <code>Ti.UI.Button</code>.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.2.0</li><li class='platform-iphone'\n        title='iPhone'>3.2.0</li><li class='platform-ipad'\n        title='iPad'>3.2.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-bubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-bubbleParent' class='name expandable'>bubbleParent</a><span> : Boolean</span></div><div class='description'><div class='short'>Indicates if the proxy will bubble an event to its parent. ...</div><div class='long'><p>Indicates if the proxy will bubble an event to its parent.</p>\n\n<p><p>Some proxies (most commonly views) have a relationship to other proxies, often\nestablished by the add() method. For example, for a button added to a window, a\nclick event on the button would bubble up to the window. Other common parents are\ntable sections to their rows, table views to their sections, and scrollable views\nto their views. Set this property to false to disable the bubbling to the proxy's parent.</p>\n\n</p><p>Default: true</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-lifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-lifecycleContainer' class='name not-expandable'>lifecycleContainer</a><span> : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></span></div><div class='description'><div class='short'><p>The Window or TabGroup whose Activity lifecycle should be triggered on the proxy.</p>\n\n</div><div class='long'><p>The Window or TabGroup whose Activity lifecycle should be triggered on the proxy.</p>\n\n<p><p>If this property is set to a Window or TabGroup, then the corresponding Activity lifecycle event callbacks\nwill also be called on the proxy. Proxies that require the activity lifecycle will need this property set\nto the appropriate containing Window or TabGroup.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-opened' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-property-opened' class='name expandable'>opened</a><span> : Boolean</span><strong class='deprecated signature' >deprecated</strong><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'>Indicates if Safari dialog is opened. ...</div><div class='long'><p>Indicates if Safari dialog is opened.</p>\n\n        <div class='signature-box deprecated'>\n        <p><strong>deprecated</strong> <p>6.3.0 Use the &lt;<a href=\"#!/api/Modules.SafariDialog-method-isOpen\" rel=\"Modules.SafariDialog-method-isOpen\" class=\"docClass\">Modules.SafariDialog.isOpen</a>> method instead.</p>\n\n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>\n\n</p>\n        </div>\n</div></div></div><div id='property-supported' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-property-supported' class='name expandable'>supported</a><span> : Boolean</span><strong class='deprecated signature' >deprecated</strong><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'>Indicates if Safari dialog is supported. ...</div><div class='long'><p>Indicates if Safari dialog is supported.</p>\n\n        <div class='signature-box deprecated'>\n        <p><strong>deprecated</strong> <p>6.3.0 Use the &lt;<a href=\"#!/api/Modules.SafariDialog-method-isSupported\" rel=\"Modules.SafariDialog-method-isSupported\" class=\"docClass\">Modules.SafariDialog.isSupported</a>> method instead.</p>\n\n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>\n\n</p>\n        </div>\n</div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-addEventListener' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-addEventListener' class='name expandable'>addEventListener</a>( <span class='pre'>name, callback</span> )</div><div class='description'><div class='short'>Adds the specified callback as an event listener for the named event. ...</div><div class='long'><p>Adds the specified callback as an event listener for the named event.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to invoke when the event is fired.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-applyProperties' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-applyProperties' class='name expandable'>applyProperties</a>( <span class='pre'>props</span> )</div><div class='description'><div class='short'>Applies the properties to the proxy. ...</div><div class='long'><p>Applies the properties to the proxy.</p>\n\n<p><p>Properties are supplied as a dictionary. Each key-value pair in the object is applied to the proxy such that\nmyproxy[key] = value.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>props</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a><div class='sub-desc'><p>A dictionary of properties to apply.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-close' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-method-close' class='name expandable'>close</a>( <span class='pre'></span> )</div><div class='description'><div class='short'>Programmatically closes the Safari dialog. ...</div><div class='long'><p>Programmatically closes the Safari dialog.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>\n\n<p><p>var dialog = require('ti.safaridialog');\nif (dialog.isOpen()) {\n    dialog.close();\n}</p>\n\n</p><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-createAuthenticationSession' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-method-createAuthenticationSession' class='name expandable'>createAuthenticationSession</a>( <span class='pre'>[parameters]</span> ) : <a href=\"#!/api/Modules.SafariDialog.AuthenticationSession\" rel=\"Modules.SafariDialog.AuthenticationSession\" class=\"docClass\">Modules.SafariDialog.AuthenticationSession</a></div><div class='description'><div class='short'>Creates and returns an instance of Modules.SafariDialog.AuthenticationSession. ...</div><div class='long'><p>Creates and returns an instance of <a href=\"#!/api/Modules.SafariDialog.AuthenticationSession\" rel=\"Modules.SafariDialog.AuthenticationSession\" class=\"docClass\">Modules.SafariDialog.AuthenticationSession</a>.</p>\n\n<ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>6.3.0</li><li class='platform-ipad'\n        title='iPad'>6.3.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>parameters</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a>&lt;<a href=\"#!/api/Modules.SafariDialog.AuthenticationSession\" rel=\"Modules.SafariDialog.AuthenticationSession\" class=\"docClass\">Modules.SafariDialog.AuthenticationSession</a>&gt; (optional)<div class='sub-desc'><p>Properties to set on a new object, including any defined by <a href=\"#!/api/Modules.SafariDialog.AuthenticationSession\" rel=\"Modules.SafariDialog.AuthenticationSession\" class=\"docClass\">Modules.SafariDialog.AuthenticationSession</a> except those marked not-creation or read-only.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Modules.SafariDialog.AuthenticationSession\" rel=\"Modules.SafariDialog.AuthenticationSession\" class=\"docClass\">Modules.SafariDialog.AuthenticationSession</a></span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-fireEvent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-fireEvent' class='name expandable'>fireEvent</a>( <span class='pre'>name, event</span> )</div><div class='description'><div class='short'>Fires a synthesized event to any registered listeners. ...</div><div class='long'><p>Fires a synthesized event to any registered listeners.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>event</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a><div class='sub-desc'><p>A dictionary of keys and values to add to the <a href=\"#!/api/Titanium.Event\" rel=\"Titanium.Event\" class=\"docClass\">Titanium.Event</a> object sent to the listeners.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-getApiName' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getApiName' class='name expandable'>getApiName</a>( <span class='pre'></span> ) : String</div><div class='description'><div class='short'>Gets the value of the apiName property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-apiName\" rel=\"Titanium.Proxy-property-apiName\" class=\"docClass\">apiName</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.2.0</li><li class='platform-iphone'\n        title='iPhone'>3.2.0</li><li class='platform-ipad'\n        title='iPad'>3.2.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getBubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getBubbleParent' class='name expandable'>getBubbleParent</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>Gets the value of the bubbleParent property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-bubbleParent\" rel=\"Titanium.Proxy-property-bubbleParent\" class=\"docClass\">bubbleParent</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getLifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getLifecycleContainer' class='name expandable'>getLifecycleContainer</a>( <span class='pre'></span> ) : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></div><div class='description'><div class='short'>Gets the value of the lifecycleContainer property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-lifecycleContainer\" rel=\"Titanium.Proxy-property-lifecycleContainer\" class=\"docClass\">lifecycleContainer</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getOpened' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-method-getOpened' class='name expandable'>getOpened</a>( <span class='pre'></span> ) : Boolean<strong class='deprecated signature' >deprecated</strong></div><div class='description'><div class='short'>Gets the value of the opened property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Modules.SafariDialog-property-opened\" rel=\"Modules.SafariDialog-property-opened\" class=\"docClass\">opened</a> property.</p>\n\n        <div class='signature-box deprecated'>\n        <p><strong>deprecated</strong> since 6.3.0 <p>Use the &lt;<a href=\"#!/api/Modules.SafariDialog-method-isOpen\" rel=\"Modules.SafariDialog-method-isOpen\" class=\"docClass\">Modules.SafariDialog.isOpen</a>> method instead.</p>\n</p>\n        </div>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getSupported' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-method-getSupported' class='name expandable'>getSupported</a>( <span class='pre'></span> ) : Boolean<strong class='deprecated signature' >deprecated</strong></div><div class='description'><div class='short'>Gets the value of the supported property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Modules.SafariDialog-property-supported\" rel=\"Modules.SafariDialog-property-supported\" class=\"docClass\">supported</a> property.</p>\n\n        <div class='signature-box deprecated'>\n        <p><strong>deprecated</strong> since 6.3.0 <p>Use the &lt;<a href=\"#!/api/Modules.SafariDialog-method-isSupported\" rel=\"Modules.SafariDialog-method-isSupported\" class=\"docClass\">Modules.SafariDialog.isSupported</a>> method instead.</p>\n</p>\n        </div>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-isOpen' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-method-isOpen' class='name expandable'>isOpen</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>Indicates if Safari dialog is open. ...</div><div class='long'><p>Indicates if Safari dialog is open.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-isSupported' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-method-isSupported' class='name expandable'>isSupported</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>Indicates if Safari dialog is supported. ...</div><div class='long'><p>Indicates if Safari dialog is supported.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-open' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-method-open' class='name expandable'>open</a>( <span class='pre'>params</span> )</div><div class='description'><div class='short'>Opens the SafariDialog with the options provided. ...</div><div class='long'><p>Opens the SafariDialog with the options provided.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 9.0 and later \n</p>\n\n<p><p>var dialog = require('ti.safaridialog');\nif (dialog.isSupported()) {\n    dialog.open({\n        url: '<a href=\"http://appcelerator.com\">http://appcelerator.com</a>',\n        title: 'Hello World',\n        tintColor: 'red'\n    });\n}</p>\n\n</p><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>params</span> : <a href=\"#!/api/SafariDialogOpenParams\" rel=\"SafariDialogOpenParams\" class=\"docClass\">SafariDialogOpenParams</a><div class='sub-desc'><p>Dictionary used to configure the Safari dialog.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-removeEventListener' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-removeEventListener' class='name expandable'>removeEventListener</a>( <span class='pre'>name, callback</span> )</div><div class='description'><div class='short'>Removes the specified callback as an event listener for the named event. ...</div><div class='long'><p>Removes the specified callback as an event listener for the named event.</p>\n\n<p><p>Multiple listeners can be registered for the same event, so the\n<code>callback</code> parameter is used to determine which listener to remove.</p>\n\n\n\n\n<p>When adding a listener, you must save a reference to the callback function\nin order to remove the listener later:</p>\n\n\n\n\n<pre><code>var listener = function() { Ti.API.info(\"Event listener called.\"); }\nwindow.addEventListener('click', listener);\n</code></pre>\n\n\n\n\n<p>To remove the listener, pass in a reference to the callback function:</p>\n\n\n\n\n<pre><code>window.removeEventListener('click', listener);\n</code></pre>\n\n</p><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to remove. Must be the same function passed to <code>addEventListener</code>.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-setBubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-setBubbleParent' class='name expandable'>setBubbleParent</a>( <span class='pre'>bubbleParent</span> )</div><div class='description'><div class='short'>Sets the value of the bubbleParent property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.Proxy-property-bubbleParent\" rel=\"Titanium.Proxy-property-bubbleParent\" class=\"docClass\">bubbleParent</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>bubbleParent</span> : Boolean<div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-setLifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-setLifecycleContainer' class='name expandable'>setLifecycleContainer</a>( <span class='pre'>lifecycleContainer</span> )</div><div class='description'><div class='short'>Sets the value of the lifecycleContainer property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.Proxy-property-lifecycleContainer\" rel=\"Titanium.Proxy-property-lifecycleContainer\" class=\"docClass\">lifecycleContainer</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>lifecycleContainer</span> : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a><div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-event'>Events</h3><div class='subsection'><div id='event-close' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-event-close' class='name expandable'>close</a></div><div class='description'><div class='short'>The close event is fired when the Safari dialog is closed by the user \nor programmatically. ...</div><div class='long'><p>The close event is fired when the Safari dialog is closed by the user \nor programmatically.</p>\n\n<h3 class=\"pa\">Properties</h3><ul><li><span class='pre'>url</span> : String<div class='sub-desc'><p>The URL provided when opening the Safari dialog</p>\n\n</div></li><li><span class='pre'>bubbles</span> : Boolean<div class='sub-desc'><p>True if the event will try to bubble up if possible.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>cancelBubble</span> : Boolean<div class='sub-desc'><p>Set to true to stop the event from bubbling.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>source</span> : Object<div class='sub-desc'><p>Source object that fired the event.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li><li><span class='pre'>type</span> : String<div class='sub-desc'><p>Name of the event fired.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li></ul></div></div></div><div id='event-load' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-event-load' class='name expandable'>load</a></div><div class='description'><div class='short'>Fired when the initial URL load is complete. ...</div><div class='long'><p>Fired when the initial URL load is complete.</p>\n\n<p><p>This event is invoked when the safari dialog completes the loading of the \nURL that you pass to it's initializer. It is not invoked for any subsequent \npage loads in the same safari dialog instance. </p>\n\n\n\n\n<p>Note: This event is available in Titanium SDK 6.0.0 and later.</p>\n\n</p><h3 class=\"pa\">Properties</h3><ul><li><span class='pre'>url</span> : String<div class='sub-desc'><p>The URL provided when opening the Safari dialog</p>\n\n</div></li><li><span class='pre'>success</span> : Boolean<div class='sub-desc'><p>Returns <code>true</code> if loading completed successfully, <code>false</code> otherwise.</p>\n\n</div></li><li><span class='pre'>bubbles</span> : Boolean<div class='sub-desc'><p>True if the event will try to bubble up if possible.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>cancelBubble</span> : Boolean<div class='sub-desc'><p>Set to true to stop the event from bubbling.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>source</span> : Object<div class='sub-desc'><p>Source object that fired the event.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li><li><span class='pre'>type</span> : String<div class='sub-desc'><p>Name of the event fired.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li></ul></div></div></div><div id='event-open' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Modules.SafariDialog'>Modules.SafariDialog</span></div><a href='#!/api/Modules.SafariDialog-event-open' class='name expandable'>open</a></div><div class='description'><div class='short'>The open event is fired after the Safari dialog has opened. ...</div><div class='long'><p>The open event is fired after the Safari dialog has opened.</p>\n\n<h3 class=\"pa\">Properties</h3><ul><li><span class='pre'>url</span> : String<div class='sub-desc'><p>The URL provided when opening the Safari dialog</p>\n\n</div></li><li><span class='pre'>bubbles</span> : Boolean<div class='sub-desc'><p>True if the event will try to bubble up if possible.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>cancelBubble</span> : Boolean<div class='sub-desc'><p>Set to true to stop the event from bubbling.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li></ul></div></li><li><span class='pre'>source</span> : Object<div class='sub-desc'><p>Source object that fired the event.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li><li><span class='pre'>type</span> : String<div class='sub-desc'><p>Name of the event fired.</p>\n\n<ul class=\"platforms\"><li class='platform-android' title='Android' >&nbsp;</li><li class='platform-iphone' title='iPhone' >&nbsp;</li><li class='platform-ipad' title='iPad' >&nbsp;</li><li class='platform-windowsphone' title='Windows Phone' >&nbsp;</li></ul></div></li></ul></div></div></div></div></div></div></div>"});